import React, {Component} from "react";
import {BrowserRouter} from "react-router-dom"
import Home from "./Home";

class App extends Component {
  render() {
    return (
      <div className='main'>
        <BrowserRouter>
        <Home />
        </BrowserRouter>
      </div>
    )
  }
}

export default App;
